import matplotlib.pyplot as plt
import numpy as np

def running_mean(x, N):
    cumsum = np.cumsum(np.insert(x, 0, 0))
    return (cumsum[N:] - cumsum[:-N]) / N

plt.title('interaction FPS')
plt.xlabel('Data point number in view')
plt.xscale('log')
for lib, data in I_DATA.items():
    x = data['xRange'][10:-5]
    time = running_mean(data['time'][5:], 11)
    fps = 1000 / time
    plt.plot(x, fps, label=lib)

plt.legend()
plt.tight_layout()
plt.savefig('docs/interaction.png')
